Stop a room from being bridged. This will remove IRC ghost users from the room and disconnect Matrix users from the channel. The Admin Room features a less powerful version of this command. Request Body { "room_id": "!foo:bar", // The Matrix Room ID. Required. "domain": "irc.foo.bar", // The IRC domain. Required. "channel": "#evilcave", // The IRC channel. Required. "leave_notice": true, // Should a notice be sent on unbridge. Default: true. "remove_alias": true, // Should the room alias for the room be removed. Default: true.
} Response Body The response body will contain a JSON array of stages that were successful and failed as it's possible for this command to only be partially successful. Typical successful response: { error: [], stages: ["Removed room from store", "Left notice in room", "Deleted alias for room", "Parted clients where applicable."],
} Typical error response: { error: ["Room not found"], stages: [],
}
